            if (soleProprietorship._VatAbsenceReasonOption.IsSet && soleProprietorship.VatAbsenceReason != null) 
            {
                string? vatAbsenceReasonRawValue = SoleProprietorship.VatAbsenceReasonEnum.ToJsonValue(soleProprietorship._VatAbsenceReasonOption.Value!.Value);
                writer.WriteString("vatAbsenceReason", vatAbsenceReasonRawValue);
            }
            
            if (soleProprietorship._VatNumberOption.IsSet)
                if (soleProprietorship.VatNumber != null)
                    writer.WriteString("vatNumber", soleProprietorship.VatNumber);
        }
    }
